import React, { useState } from "react";
import { FaLock, FaUser, FaEye, FaEyeSlash } from "react-icons/fa";

const users = [
  {
    username: "Hasaan",
    password: "hash905hasaan",
    avatar:
      "data:image/jpeg;base64,",
  },
  {
    username: "Umer",
    password: "umer564true",
    avatar:
      "https://media.licdn.com/dms/image/D4D03AQE8AhZKHNMDkA/profile-displayphoto-shrink_200_200/0/1699619320109?e=1721865600&v=beta&t=DTXoNVLfPjQznTpkdkW70SmUoVXFj5gN2gAecclklbE",
  },
  {
    username: "Arbab",
    password: "spsarbab90",
    avatar: "https://example.com/avatar3.jpg",
  },
  {
    username: "Imranahmad",
    password: "905imranlashari",
    avatar:
      "https://media.licdn.com/dms/image/D4D03AQFtildZnWDkNA/profile-displayphoto-shrink_200_200/0/1710777461854?e=1721865600&v=beta&t=gklmZKHbYPcdOh8ZbOIejXoGIjbECYkm_QN5fHth2GQ",
  },
];

const Login = ({ onLogin }: { onLogin: () => void }) => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const [isPasswordVisible, setIsPasswordVisible] = useState(false);

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();

    const user = users.find((user) => user.username === username);

    if (user && user.password === password) {
      localStorage.setItem("isAuthenticated", "true");
      localStorage.setItem("avatar", user.avatar);
      localStorage.setItem("username", user.username);
      onLogin();
    } else {
      setError("Incorrect username or password");
    }
  };

  return (
    <div className="flex items-center justify-center h-screen bg-gray-100">
      <form onSubmit={handleSubmit} className="bg-white p-6 rounded shadow-md">
        <h2 className="mb-4 text-xl font-bold">Admin Login</h2>
        <div className="mb-4">
          <label className="block mb-2">Username</label>
          <div className="relative">
            <span className="absolute inset-y-0 left-0 pl-3 flex items-center text-gray-500">
              <FaUser />
            </span>
            <input
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              className="w-full pl-10 p-2 border border-gray-300 rounded"
              required
            />
          </div>
        </div>
        <div className="mb-4">
          <label className="block mb-2">Password</label>
          <div className="relative">
            <span className="absolute inset-y-0 left-0 pl-3 flex items-center text-gray-500">
              <FaLock />
            </span>
            <input
              type={isPasswordVisible ? "text" : "password"}
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="w-full pl-10 p-2 border border-gray-300 rounded"
              required
            />
            <button
              type="button"
              onClick={() => setIsPasswordVisible(!isPasswordVisible)}
              className="absolute inset-y-0 right-0 pr-3 flex items-center text-gray-600"
            >
              {isPasswordVisible ? <FaEyeSlash /> : <FaEye />}
            </button>
          </div>
        </div>
        {error && <p className="text-red-500">{error}</p>}
        <button
          type="submit"
          className="w-full bg-blue-500 text-white p-2 rounded"
        >
          Login
        </button>
      </form>
    </div>
  );
};

export default Login;
